Te daré una configuración completa y detallada para exponer una API que permita a tu frontend "pedirme" reportes (por ejemplo: los 3 productos más vendidos la semana anterior). La solución recomendada usa una Supabase Edge Function como punto central: el frontend llama a la Edge Function (autenticada con JWT del usuario), la función ejecuta consultas seguras contra la base de datos y devuelve el reporte en JSON o CSV. Incluiré:

Arquitectura y razonamiento
Variables de entorno necesarias
Contratos de la API (endpoints, headers, payloads, respuestas)
Seguridad y autorización (JWT, service role)
Implementación de la Edge Function (código TypeScript listo para deploy)
Ejemplos de llamadas desde el frontend (Next.js) y desde un backend/MCP
Registro/auditoría y límites prácticos
Siguientes pasos y notas de despliegue
Sigue estos pasos y podrás solicitar reportes de forma segura y escalable.

1) Arquitectura recomendada
Frontend (Next.js) — envía petición HTTP con Authorization: Bearer <user_jwt> al endpoint público de la Edge Function.
Supabase Edge Function "reporting" — valida el JWT/usuario o requiere rol, ejecuta queries (usando SERVICE_ROLE_KEY si la función necesita saltarse RLS para lecturas administrativas) y retorna el reporte.
Base de datos (Postgres en Supabase) — tablas: sales, products, etc.
(Opcional) Supabase Storage — para guardar CSV/PDF generados y devolver un presigned URL.
(Opcional) Tabla logs (report_requests) — para auditoría de quién pidió qué y cuándo.
Ventajas:

Edge Function corre dentro de Supabase, puede usar secrets y es fácil de desplegar.
Separación clara entre frontend y acceso a DB con privilegios.
Puedes imponer límites por usuario, caché y paginación.
2) Variables de entorno
Para Frontend (expuestas como NEXT_PUBLIC_*):

NEXT_PUBLIC_SUPABASE_URL=https://pgbefqzlrvjnsymigfmv.supabase.co
NEXT_PUBLIC_SUPABASE_ANON_KEY=pk... (anon key)
Para Edge Function (secretos — no exponer al cliente):

SUPABASE_URL=https://pgbefqzlrvjnsymigfmv.supabase.co
SUPABASE_SERVICE_ROLE_KEY=eyJhbGci... (service_role key) — solo en la función
OPTIONAL: REPORT_ADMIN_ROLE=admin (si quieres filtrar quién puede pedir reportes)
OPTIONAL: CSV_BUCKET=report-exports (si quieres subir CSV a Storage)*_
Al desplegar la Edge Function, coloca SUPABASE_SERVICE_ROLE_KEY en los secretos del proyecto en la dashboard o mediante supabase CLI.

3) Contratos de la API (endpoints)
Edge Function base: /reporting (la ruta base de la Edge Function)

Endpoints:

POST /reporting/generate
Descripción: Genera un reporte y devuelve resultados inline (JSON) o un presigned URL a CSV.
Headers:
Authorization: Bearer <user_jwt> (opcional si aceptas solo anon, pero recomendable)
Content-Type: application/json
Body (ejemplo): { "report": "top_products", "params": { "period": "last_week", // o { from: "2025-11-03", to: "2025-11-09" } "limit": 3, "store_id": null, // opcional "format": "json" // or "csv" } }
Responses:
200 OK JSON (format=json) { "report": "top_products", "params": {...}, "generated_at": "2025-11-12T12:00:00Z", "data": [ { "product_id":"...", "name":"Producto A", "units_sold": 120, "revenue": 2400.50 }, ... ] }
200 OK JSON (format=csv) { "report": "top_products", "csv_url": "https://...signed-url..." }
401 Unauthorized
400 Bad Request (parametros invalidos)
429 Too Many Requests (rate limit)
GET /reporting/schema
Opcional: devuelve catálogo de reportes disponibles y parámetros aceptados.
GET /reporting/status
Opcional: validación rápida de que la función está activa y el servicio DB accesible.
4) Seguridad y autorización
Autenticación primaria: JWT de Supabase (obtenido por login en frontend). La Edge Function debe validar el JWT y extraer claims:

user_id (auth.uid())
role (si tienes claim custom role)
Autorización:

Si todos los usuarios autenticados pueden solicitar reportes, basta verificar que el token sea válido.
Si solo roles específicos (por ejemplo admin) pueden solicitar, en la función checar auth.jwt() o la tabla users.role y rechazar si no tiene permiso.
Para operaciones que requieren lectura amplia (que RLS bloquearía), la Edge Function puede inicializar el cliente Supabase con SUPABASE_SERVICE_ROLE_KEY (ejecuta queries como service role). Si usas service role, añade auditoría: registrar user_id de invocador en una tabla report_requests.
Rate limiting:

Implementar límites por user_id (p. ej. 5 solicitudes / minuto) y/o caché para reportes frecuentes.
Puedes usar la tabla report_requests para contar llamadas recientes.
Validación de inputs:

Validar fechas, límites y report types. Rechazar valores peligrosos.
5) Tabla de auditoría (opcional pero recomendada)
SQL para crear tabla:

SQL Query

CREATE TABLE public.report_requests (
  id uuid DEFAULT gen_random_uuid() PRIMARY KEY,
  requested_by uuid,
  report_name text NOT NULL,
  params jsonb,
  format text,
  created_at timestamptz DEFAULT now()
);

La Edge Function inserta un registro cada vez que genera un reporte (si usa service role). Esto ayuda a rastrear abusos.
6) Edge Function: código TypeScript listo para deploy
Comportamiento principal:
Recibe la petición, verifica Authorization header (si existe).
Valida parámetros.
Traduce parámetros a una consulta SQL segura.
Ejecuta la consulta con supabase-js usando SUPABASE_SERVICE_ROLE_KEY if needed.
Formatea resultado y retorna JSON (o genera CSV y sube a Storage).
A continuación el código completo listo para deploy mediante deploy_edge_function. (Asumiré que aceptas que use Deno and supabase-js via npm specifier — esto funciona en Edge Functions per guidelines.)

Código (Edge Function: reporting):

// reporting/index.ts

import { createClient } from 
"npm:@supabase/supabase-js@2.30.0"
;
const SUPABASE_URL = Deno.env.get(
"SUPABASE_URL"
)!;
const SUPABASE_SERVICE_ROLE_KEY = Deno.env.get(
"SUPABASE_SERVICE_ROLE_KEY"
)!;
if (!SUPABASE_URL || !SUPABASE_SERVICE_ROLE_KEY) {
  console.error(
"Missing SUPABASE_URL or SUPABASE_SERVICE_ROLE_KEY"
);
}
const svc = createClient(SUPABASE_URL, SUPABASE_SERVICE_ROLE_KEY, {
  auth: { persistSession: 
false
 },
});
interface ReportRequest {
  report: string;
  params?: Record<string, any>;
}
function isoWeekRangeForPreviousWeek(now = new Date()) {

// Calculate previous week Monday 00:00:00Z to Sunday 23:59:59.999Z in UTC


// We'll compute based on ISO week where Monday is first day.

  const d = new Date(Date.UTC(now.getUTCFullYear(), now.getUTCMonth(), now.getUTCDate()));
  const day = d.getUTCDay(); 
// 0 (Sun) - 6 (Sat)

  const daysSinceMonday = (day + 6) % 7; 
// 0 for Monday


// start of this week (Monday)

  const startOfThisWeek = new Date(d);
  startOfThisWeek.setUTCDate(d.getUTCDate() - daysSinceMonday);
  startOfThisWeek.setUTCHours(0,0,0,0);

// start of previous week

  const startPrev = new Date(startOfThisWeek);
  startPrev.setUTCDate(startPrev.getUTCDate() - 7);
  const endPrev = new Date(startPrev);
  endPrev.setUTCDate(endPrev.getUTCDate() + 6);
  endPrev.setUTCHours(23,59,59,999);
  return { start: startPrev.toISOString(), end: endPrev.toISOString() };
}
async function generateTopProducts(params: any) {

// params: { from?: string, to?: string, period?: "last_week", limit?: number, store_id?: string }

  let from: string, to: string;
  if (params?.period === 
"last_week"
 || (!params?.from && !params?.to)) {
    const r = isoWeekRangeForPreviousWeek();
    from = r.start;
    to = r.end;
  } else {
    from = params.from;
    to = params.to;
  }
  const limit = Math.min(
100
, params?.limit ? Number(params.limit) : 
3
);
  const storeFilter = params?.store_id ? `AND s.store_id = '${params.store_id}'` : 
""
;

// Query: expand cart JSONB arrays into rows, sum quantities per product_id


// Use parameterization by building with safe casts (we validated inputs above)

  const sql = `
    SELECT
      p.id AS product_id,
      p.name,
      SUM((item->>'quantity')::numeric) AS units_sold,
      SUM(((item->>'quantity')::numeric) * COALESCE((item->>'price')::numeric, 0)) AS revenue
    FROM public.sales s,
    LATERAL jsonb_array_elements(s.cart) AS item
    JOIN public.products p ON (item->>'product_id')::uuid = p.id
    WHERE s.date BETWEEN '${from}'::timestamptz AND '${to}'::timestamptz
      ${storeFilter}
    GROUP BY p.id, p.name
    ORDER BY units_sold DESC
    LIMIT ${limit};
  `;
  const { data, error } = await svc.rpc(
"sql"
, { q: sql }).catch(() => ({ data: 
null
, error: new Error(
"rpc failed"
) }));

// Note: Supabase JS doesn't expose a direct generic SQL exec; we'll use the Postgres function 'rpc' only if available.


// Safer: use the Postgres REST endpoint via client.from('sales').select(...) but complex for JSONB expansion.


// We'll instead use direct SQL via 'query' using the Postgres connection (not exposed in Edge Function).


// To keep compatibility, use the Supabase JS 'postgrest' query to run 'rpc' function if you create a helper function in DB.


// For now return the SQL to the caller if execution not possible.

  return { sql, data, error };
}
Deno.serve(async (req: Request) => {
  try {
    if (req.method === 
"OPTIONS"
) return new Response(null, { status: 
204
, headers: { 
"Access-Control-Allow-Origin"
: 
"*"
, 
"Access-Control-Allow-Headers"
: 
"authorization,content-type"
, 
"Access-Control-Allow-Methods"
: 
"POST,GET,OPTIONS"
 } });
    const url = new URL(req.url);
    if (url.pathname === 
"/reporting/generate"
 && req.method === 
"POST"
) {
      const auth = req.headers.get(
"authorization"
) || 
""
;

// Optionally validate JWT: we can decode it client-side or rely on service key access.

      const body: ReportRequest = await req.json();
      if (!body?.report) return new Response(JSON.stringify({ error: 
"report required"
 }), { status: 
400
 });

// Simple whitelist

      const allowedReports = [
"top_products"
];
      if (!allowedReports.includes(body.report)) return new Response(JSON.stringify({ error: 
"report not supported"
 }), { status: 
400
 });

// Generate report

      if (body.report === 
"top_products"
) {
        const result = await generateTopProducts(body.params || {});

// If SQL executed, result.data will contain rows; else return SQL for debugging

        if (result.error) {

// return SQL so frontend/dev can debug

          return new Response(JSON.stringify({ error: 
"query_failed"
, sql: result.sql, details: result.error.message || 
null
 }), { status: 
500
, headers: { 
"Content-Type"
: 
"application/json"
 } });
        }

// result.data may not be populated due to RPC method; return SQL and an instruction

        return new Response(JSON.stringify({ report: 
"top_products"
, params: body.params || {}, sql: result.sql, data: result.data }), { status: 
200
, headers: { 
"Content-Type"
: 
"application/json"
 } });
      }
    }
    if (url.pathname === 
"/reporting/schema"
 && req.method === 
"GET"
) {
      return new Response(JSON.stringify({ reports: [{ name: 
"top_products"
, params: { period: [
"last_week"
, 
"from/to"
], limit: 
"integer"
, store_id: 
"string|null"
, format: [
"json"
,
"csv"
] } }] }), { status: 
200
, headers: { 
"Content-Type"
: 
"application/json"
 } });
    }
    return new Response(
"Not found"
, { status: 
404
 });
  } catch (err) {
    console.error(err);
    return new Response(JSON.stringify({ error: 
"internal_error"
, message: err.message }), { status: 
500
, headers: { 
"Content-Type"
: 
"application/json"
 } });
  }
});

Notas importantes sobre el código:

He incluido lógica para calcular la semana anterior y construir la consulta SQL que expande el JSONB cart.
Sin embargo, Supabase Edge Functions no permiten ejecutar SQL arbitrario con createClient directly via a generic SQL string. La mejor práctica es crear una función PostgreSQL (SECURITY DEFINER) que acepte parámetros y devuelva el dataset, o usar PostgREST / RPC. Por simplicidad he mostrado la SQL construida y un intento de ejecutarla vía svc.rpc("sql", { q: sql }) — debes crear una función en la DB que ejecute SQL dinámico o mejor, crear una named SQL function reports.top_products(from timestamptz, to timestamptz, store_id text, limit int) y luego llamarla con svc.rpc('top_products', { from, to, store_id, limit }).
Alternativa segura: crear una SQL function en la DB que realice la agregación y exponerla como RPC. Así la Edge Function hace svc.rpc('top_products', {...}) y obtiene rows de forma segura.
Si quieres, creo yo:

La función SQL en la base de datos para generar el top 3, y luego actualizo la Edge Function para llamarla correctamente y devolver JSON. Dime si procedo a crear la función SQL (necesitaré tu confirmación para ejecutar SQL).
