async function callRpcSafe(name: string, params: Record<string, any>) {
  try {
    const { data, error } = await svc.rpc(name, params);
    if (error) {
      console.error("RPC error", name, error);
      return { error: error.message || "rpc_error", data: null };
    }
    return { error: null, data };
  } catch (err) {
    console.error("RPC call exception", name, err);
    return { error: err?.message ?? "rpc_exception", data: null };
  }
}

