// JWT verification using JWKS (Deno)
// Place as an Edge Function. Assumes SUPABASE_URL env var present.
const JWKS_URL = `${Deno.env.get("SUPABASE_URL")}/.well-known/jwks.json`;

// Simple in-memory cache
let jwksCache: { keys: any[]; fetchedAt: number } | null = null;
const JWKS_TTL = 1000 * 60 * 60; // 1 hour

async function fetchJWKS() {
  if (jwksCache && (Date.now() - jwksCache.fetchedAt) < JWKS_TTL) return jwksCache.keys;
  const res = await fetch(JWKS_URL);
  if (!res.ok) throw new Error(`Failed to fetch JWKS: ${res.status}`);
  const jwks = await res.json();
  jwksCache = { keys: jwks.keys, fetchedAt: Date.now() };
  return jwks.keys;
}

// base64url decoding
function base64UrlDecode(str: string) {
  str = str.replace(/-/g, '+').replace(/_/g, '/');
  const pad = str.length % 4;
  if (pad) str += '='.repeat(4 - pad);
  const bytes = atob(str);
  const arr = new Uint8Array(bytes.length);
  for (let i = 0; i < bytes.length; i++) arr[i] = bytes.charCodeAt(i);
  return arr.buffer;
}

async function verifyJwt(token: string) {
  const parts = token.split('.');
  if (parts.length !== 3) throw new Error('Invalid JWT structure');
  const header = JSON.parse(new TextDecoder().decode(base64UrlDecode(parts[0])));
  const kid = header.kid;
  const alg = header.alg;

  const keys = await fetchJWKS();
  const jwk = keys.find((k: any) => k.kid === kid);
  if (!jwk) throw new Error('JWK not found for kid: ' + kid);

  // Import JWK to CryptoKey
  let cryptoKey: CryptoKey;
  if (jwk.kty === 'EC') {
    cryptoKey = await crypto.subtle.importKey(
      'jwk',
      jwk,
      { name: 'ECDSA', namedCurve: jwk.crv === 'P-256' ? 'P-256' : jwk.crv },
      false,
      ['verify']
    );
  } else if (jwk.kty === 'RSA') {
    cryptoKey = await crypto.subtle.importKey(
      'jwk',
      jwk,
      { name: 'RSASSA-PKCS1-v1_5', hash: 'SHA-256' },
      false,
      ['verify']
    );
  } else {
    throw new Error('Unsupported JWK kty: ' + jwk.kty);
  }

  // Verify signature
  const signed = parts[0] + '.' + parts[1];
  const signature = base64UrlDecode(parts[2]);
  let verifyOk = false;
  if (jwk.kty === 'EC') {
    // ECDSA signature in DER expected by Web Crypto; but JWT uses r||s raw. Convert is complex.
    // We'll rely on SubtleCrypto.verify with ECDSA and 'raw' is not accepted; attempt verify directly:
    // Note: Deno's Web Crypto supports 'verify' with signature in DER for ECDSA. Converting r||s -> DER is required.
    // Fallback: attempt verify as-is; if it fails, throw useful message.
    verifyOk = await crypto.subtle.verify(
      { name: 'ECDSA', hash: 'SHA-256' },
      cryptoKey,
      signature,
      new TextEncoder().encode(signed)
    ).catch(() => false);
    if (!verifyOk) throw new Error('ECDSA verification failed. Ensure runtime supports ECDSA JWT verification or use RS256/JWKS with RSA keys.');
  } else {
    // RSA verify
    verifyOk = await crypto.subtle.verify(
      { name: 'RSASSA-PKCS1-v1_5' , hash: 'SHA-256'},
      cryptoKey,
      signature,
      new TextEncoder().encode(signed)
    );
  }

  if (!verifyOk) throw new Error('Signature verification failed');

  // Validate claims (exp, aud, iss) as needed
  const payload = JSON.parse(new TextDecoder().decode(base64UrlDecode(parts[1])));
  const now = Math.floor(Date.now() / 1000);
  if (payload.exp && now > payload.exp) throw new Error('Token expired');
  // Optionally validate issuer/audience:
  const issuer = Deno.env.get("SUPABASE_URL"); // adjust to your issuer
  if (payload.iss && !payload.iss.startsWith(issuer)) {
    throw new Error('Invalid issuer');
  }

  return payload;
}

