Notas importantes sobre el snippet

La verificación ECDSA (P-256) puede requerir conversión del formato de firma r||s a DER antes de pasar a crypto.subtle.verify; la implementación mostrada intenta verificar directamente y devuelve un error claro si falla. Si tus claves activas son ECC P-256 (como tu Standby), puede que necesitemos incluir la conversión r||s → DER (puedo añadir ese helper si quieres).
Ajusta issuer/audience checks según tus claims (usa SUPABASE_URL o el issuer real).
Cache de JWKS reduce latencia y protege contra límite de requests; refresca periódicamente.
No uses dependencias externas para esto en Edge Functions preferidas; si quieres manejo más completo (RS/ECDSA, DER conversion), puedo dar versión con una pequeña util (sin npm) o con npm:@panva/jose si prefieres (requiere import npm).
